import headerLogoPath from "../images/header__logo.svg";
import React from "react";

function Header() {
  return (
    <header className="header">
      <a href="#">
        <img
          src={headerLogoPath}
          className="header__logo"
          alt="логотип шапки"
        />
      </a>
      <div className="header__line" />
    </header>
  );
}

export default Header;
